import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <div><Header/></div>
    <ul>
      <li>HTML</li>
      <li>CSS</li>
      <li>JavaScript</li>
      <li>React</li>
    </ul>
    </div>
  )
}

function Header(){
  return (
<div>
      <a href="">Home</a>
      <a href="">About</a>
      <a href="">Contact</a>
    </div>
  )
}

export default App;
